-- Questions:


-- 1. Write a query to find month-wise registrations count in the current year.

-- Solutions: 

Select Month(RegistrationDateTime),count(customerid)
 from customer_table where year(RegistrationDateTime)=year(current_date)
 group by 1;


-- 2. Write a query to find year-wise registrations count.

-- Solution:

Select year(registrationdatetime), count(customerid) from customer_table group by 1;


-- 3. Write a query to find week-wise registrations count.

-- Solution:

select week(RegistrationDateTime),count(customerid)
from customer_table 
group by 1 ;
 

-- 4. Write a query to find current month and year registration.

-- solution:

 select year(RegistrationDateTime) as current_year ,month(RegistrationDateTime) as current_month
from customer_table 
where year(RegistrationDateTime)=year(current_date) 
and month(RegistrationDateTime)=month(current_date);


-- 5. Write a query to find the number of registrations in the last 20 days.

-- Solution:

select count(customerid) from customer_table where date(RegistrationDateTime)>current_date - interval 20 day;


-- 6. Write a query to find the number of customers who made payment within 28 days of their registrations.

-- Solution:

select count(customerid) from customer_table where 
datediff(firstpaymentdatetime,RegistrationDateTime)<28;


-- 7. Find the average number of days taken by customers to make a payment after registration.

-- solution:

select avg(datediff(firstpaymentdatetime,RegistrationDateTime))

from customer_table;


-- 8. Write a query to only fetch the year from the registration datetime column.
-- Solution:

select year(RegistrationDateTime)
from customer_table;


-- 9. Write a query to find registrations count between '2024-01-15' and '2024-05-15'.

-- solution:
select count(customerid) 
from customer_table 
where date(registrationdatetime) between  '2024-01-15' and '2024-05-15';



-- 10. Write a query to find today's registration count.

-- solution:

select count(customerid) 
from customer_table 
where date(registrationdatetime) = current_date; 


